import {
  SearchHistoryPanel,
} from "@/components/SearchHistoryPanel/SearchHistoryPanel";
import type {
  Meta,
  StoryObj,
} from "@storybook/react";

import {
  withProviders,
} from "../path-to-storybook-helpers"; // Update with the actual path to your Storybook providers helper

const meta = {
  title: "components/SearchHistoryPanel",
  component: SearchHistoryPanel,
  decorators: [withProviders], // Add any required providers/decorators here
  parameters: {
    layout: "padded",
    backgrounds: {
      default: "white",
      values: [
        {
          name: "white",
          value: "#fff",
        },
        {
          name: "theme",
          value: "#6a44c8",
        },
      ],
    },
  },
} satisfies Meta<typeof SearchHistoryPanel>;

export default meta;

type Story = StoryObj<typeof meta>;

export const Default: Story = {
  args: {},
};
